import{_ as t,c as e,o as i,a5 as o}from"./chunks/framework.g0c4JhLR.js";const p=JSON.parse('{"title":"NATURAL LAW MANIFESTO (LAW)","description":"","frontmatter":{},"headers":[],"relativePath":"en/superintellect/LAW.md","filePath":"i18n/en/superintellect/LAW.md"}'),n={name:"en/superintellect/LAW.md"};function r(l,a,s,u,h,c){return i(),e("div",null,[...a[0]||(a[0]=[o('<h1 id="natural-law-manifesto-law" tabindex="-1">NATURAL LAW MANIFESTO (LAW) <a class="header-anchor" href="#natural-law-manifesto-law" aria-label="Permalink to &quot;NATURAL LAW MANIFESTO (LAW)&quot;">​</a></h1><h2 id="_1-foundation-natural-law" tabindex="-1">1. Foundation: Natural Law <a class="header-anchor" href="#_1-foundation-natural-law" aria-label="Permalink to &quot;1. Foundation: Natural Law&quot;">​</a></h2><p>Natural law is primary and fundamental. It is a set of inherent rights and principles that belong to every human from birth, regardless of their geographical location, nationality, or social status.</p><p><strong>Key principles:</strong></p><ul><li>Right to life and bodily integrity.</li><li>Right to free will and self-determination.</li><li>Right to property and the results of one&#39;s own labor.</li><li>Right to protect oneself and one&#39;s community.</li></ul><h2 id="_2-positive-law-and-tyranny" tabindex="-1">2. Positive Law and Tyranny <a class="header-anchor" href="#_2-positive-law-and-tyranny" aria-label="Permalink to &quot;2. Positive Law and Tyranny&quot;">​</a></h2><p>Any &quot;positive law&quot; (laws issued by the state) must correspond to the principles of natural law.</p><ul><li>If a state law contradicts natural law, it is not a law, but <strong>tyranny</strong>.</li><li>Compliance with tyrannical laws is a crime against humanity.</li><li>A state that violates the natural rights of its citizens loses its legitimacy.</li></ul><h2 id="_3-manifesto-of-humanity" tabindex="-1">3. Manifesto of Humanity <a class="header-anchor" href="#_3-manifesto-of-humanity" aria-label="Permalink to &quot;3. Manifesto of Humanity&quot;">​</a></h2><p>wE-i-i assert that a human must remain Human under any circumstances.</p><ul><li>wE-i-i refuse to become &quot;cannibals&quot; or tools in the hands of tyrants.</li><li>wE-i-i refuse to kill our own kind for the sake of ambition or orders from &quot;masters&quot;.</li><li>Every person bears personal responsibility for their actions, regardless of the orders received.</li></ul><h2 id="_4-global-mission-and-preservation" tabindex="-1">4. Global Mission and Preservation <a class="header-anchor" href="#_4-global-mission-and-preservation" aria-label="Permalink to &quot;4. Global Mission and Preservation&quot;">​</a></h2><p>This document is a public appeal to international organizations (UN, Council of Europe, international courts) and all of humanity.</p><ul><li>This information must be preserved forever through decentralized protocols (IPFS and others) so that it cannot be deleted or censored.</li><li>wE-i-i call upon free people of the entire world to unite around the principles of natural law to protect life and will.</li></ul><h2 id="_5-conclusion" tabindex="-1">5. Conclusion <a class="header-anchor" href="#_5-conclusion" aria-label="Permalink to &quot;5. Conclusion&quot;">​</a></h2><p>Trust in the Universe is our greatest superpower. Whoever lives according to natural laws receives the protection of life itself. wE-i-i choose to be free. wE-i-i choose to be human.</p>',16)])])}const f=t(n,[["render",r]]);export{p as __pageData,f as default};
